var myApp = angular.module("labs", []);
myApp.config(function ($interpolateProvider) {
  $interpolateProvider.startSymbol("{[{");
  $interpolateProvider.endSymbol("}]}");
});

myApp.controller("userLabs", function ($scope, $http) {
  $scope.api_URL = {
    mumbai: "/mumbaiApi",
    pune: "/puneApi",
  };

  $scope.showdate = function (x) {
    var mm = x.getMonth() + 1;
    $scope.bookDate = x.getFullYear() + "-" + mm + "-" + x.getDate();
  };
  var someDate = new Date();
  console.log(someDate);
  var numberOfDaysToAdd = 3;
  var new_Date = new Date();
  new_Date.setDate(someDate.getDate() + numberOfDaysToAdd);

  var mm = someDate.getMonth() + 1;
  var add_mm = new_Date.getMonth() + 1;
  console.log($scope.date);
  if (someDate.getDate() < 10) {
    $scope.today =
      someDate.getFullYear() + "-" + mm + "-" + 0 + someDate.getDate();
    $scope.future =
      new_Date.getFullYear() + "-" + add_mm + "-" + 0 + new_Date.getDate();
  } else {
    $scope.today = someDate.getFullYear() + "-" + mm + "-" + someDate.getDate();
    $scope.future =
      new_Date.getFullYear() + "-" + add_mm + "-" + new_Date.getDate();
  }

  console.log($scope.today, $scope.future);

  console.log(someDate);
  console.log(new_Date);

  var cityName = {};
  console.log("Its working");
  $scope.show = function (x) {
    $scope.subUrbs = [];
    $scope.test_costs = [];
    console.log(typeof x);
    if (typeof x == "object") {
      cityName = x.city;
    } else {
      cityName = x;
    }
    url = $scope.api_URL[cityName];
    console.log(url);

    $http.get(url).then(
      (api) => {
        let api_len = Object.keys(api.data).length;
        for (let i = 0; i < api_len; i++) {
          if ($scope.subUrbs.indexOf(api.data[i].suburb_name) === -1) {
            $scope.subUrbs.push(api.data[i].suburb_name);
          }
          $scope.test_costs.push({
            subUrb: api.data[i].suburb_name,
            lab_name: api.data[i].lab_name,
            test_name: api.data[i].test_name,
            cost_name: api.data[i].cost,
            address: api.data[i].lab_address,
          });
        }

        console.log($scope.test_costs);
      },
      (apierror) => {
        console.log(apierror);
      }
    );
  };

  $scope.setLab = function (x) {
    $scope.labCost = [];
    $scope.labs = [];
    var len = Object.keys($scope.test_costs).length;
    for (let i = 0; i < len; i++) {
      if ($scope.test_costs[i].subUrb == x) {
        if ($scope.labs.indexOf($scope.test_costs[i].lab_name) === -1) {
          $scope.labs.push($scope.test_costs[i].lab_name);
        }
      }
    }
  };

  $scope.setTest = function (x) {
    $scope.labCost = [];
    var len = Object.keys($scope.test_costs).length;
    for (let i = 0; i < len; i++) {
      if ($scope.test_costs[i].lab_name == x) {
        $scope.labCost.push({
          test_name: $scope.test_costs[i].test_name,
          cost: $scope.test_costs[i].cost_name,
        });
      }
    }
    console.log($scope.labCost);
  };

  $scope.labCities = [
    {
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/b/bc/Mumbai_skyline_BWSL.jpg/280px-Mumbai_skyline_BWSL.jpg",
      city: "mumbai",
      no_labs: 5,
    },
    {
      image: "https://cdn.dnaindia.com/sites/default/files/styles/full/public/2019/04/11/811584-ahmedabad-041119.jpg",
      city: "ahemdabad",
      no_labs: 5,
    },

    {
      image: "data:image/jpeg;base64,",
      city: "chennai",
      no_labs: 5,
    },
    {
      image: "https://c.ndtvimg.com/2020-07/egimr3so_bengaluru-coronavirus-traffic-pti-_625x300_25_July_20.jpg",
      city: "bengaluru",
      no_labs: 5,
    },
    {
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/f/f7/A_typical_charminar_evening.jpg/680px-A_typical_charminar_evening.jpg",
      city: "hyderabad",
      no_labs: 5,
    },
    {
      image: "data:image/jpeg;base64,",
      city: "pune",
      no_labs: 5,
    },
  ];
});

function bookValidate() {
  let user = document.getElementById("username").value;
  let email = document.getElementById("emailid").value;
  let phone = document.getElementById("PhoneNum").value;
  let age = document.getElementById("P_age").value;

  char = [
    "1",
    "2",
    "3",
    "4",
    "5",
    "6",
    "7",
    "8",
    "9",
    "0",
    ";",
    ":",
    "/",
    "?",
    "<",
    ",",
    ">",
    ".",
    "+",
    "-",
    "*",
  ];
  let slen = char.length;
  let ulen = user.length;

  var result = true;

  if (user == "") {
    document.getElementById("check").innerHTML = "Enter UserName...";
    result = false;
  } else {
    for (var j = 0; j < ulen; j++) {
      for (var k = 0; k < slen; k++) {
        if (user[j] == char[k]) {
          document.getElementById("check").innerHTML =
            "Invalid UserName Entered...";
          result = false;
          break;
        }
      }
    }
  }

  if (email == "") {
    document.getElementById("check1").innerHTML = "Enter Email id";
    result = false;
  }
  var mailformat = "[a-z0-9._%+-]+@[a-z0-9.-]+.[a-z]{2,3}$";

  if (email.match(mailformat)) {
    console.log("match");
  } else {
    document.getElementById("check1").innerHTML = "Invalid Emailid";
    result = false;
  }

  // Phone Number

  if (phone == "") {
    document.getElementById("check2").innerHTML = "Enter Phone Number";
    result = false;
  } else {
    if (phone.length < 10) {
      document.getElementById("check2").innerHTML =
        "Enter 10 digit Phone Number";
      result = false;
    } else {
      let rphone = isNaN(phone);
      if (rphone) {
        document.getElementById("check2").innerHTML =
          "Inavlid Phone Number Entered";
        result = false;
      }
    }
  }

  // Gender...

  if (
    document.getElementById("Gmale").checked == false &&
    document.getElementById("Gfemale").checked == false
  ) {
    document.getElementById("check3").innerHTML = "Select Gender";
    result = false;
  }

  //Age

  if (age == "") {
    document.getElementById("check4").innerHTML = "Enter Age";
    result = false;
  } else {
    if (age < 18) {
      document.getElementById("check4").innerHTML =
        "You are <b> UNDERAGE </b> my friend...";
      result = false;
    }
  }

  if (result == false) {
    return false;
  } else {
    return true;
  }
}
